import { useContext } from "react"
import Box from "@material-ui/core/Box";
import Button from "@material-ui/core/Button";


function Home() {
    return (
      <div>
        <h2>HOME</h2>
        <Box component="span" m={1}>
          <Button />
        </Box>
      </div>
    );    
  }

  export default Home;
